import './App.css';
import {BrowserRouter, Route} from "react-router-dom";
import TodoListApp from "./components/TodoListApp/TodoListApp";
import Home from "./components/Home/Home";


function App() {

    return (
        <BrowserRouter>
            <div className="App">
                <Route path={'/'} render={() => <Home />} />
            </div>
        </BrowserRouter>


    );
}

export default App;
